	@override String get aboutUSCTminingItme1 => '1. USDT는 전 세계 주요 암호화폐 거래소에서 각국 법정화폐로 쉽게 교환할 수 있는 전 세계적으로 인기 있는 미국 달러 스테이블코인입니다.';
